function Home(){
    return (
        <div>
            {patients.map(patient=>{
                return (
                  <p>Patient: {patient.name}</p>
                )
              })}
                {providers.map(provider=>{
                return (
                  <p>Provider: {provider.name}</p>
                )
              })}
        </div>
    )
}

export default Home;
